rted property types: number, rich editor, single checkbox, switch, balloon selector, tag list, radio.','2019-06-14 09:25:52'),(144,'Lovata.Toolbox','comment','1.20.0','Added Japanese language. Thanks for contribution pikanji.','2019-06-14 09:25:52'),(145,'Lovata.Toolbox','comment','1.20.1','Fixed deletion of old images for improt from CSV file.','2019-06-14 09:25:52'),(146,'Lovata.Toolbox','comment','1.21.0','Added support translatable slug in ElementPage class. Added German language. Thanks for contribution Gerald.','2019-06-14 09:25:52'),(147,'Lovata.Toolbox','comment','1.21.1','Removed Iterator interface from ElementCollection class. Added IteratorAggregate interface to ElementCollection class.','2019-06-14 09:25:52'),(148,'Lovata.Toolbox','comment','1.22.0','Replace array_intersect function with array_intersect_key in ElementCollection class.','2019-06-14 09:25:52'),(149,'Lovata.Toolbox','comment','1.23.0','Added copy() method to ElementCollection class. Added choice twig function.','2019-06-14 09:25:52'),(150,'Lovata.Toolbox','comment','1.24.0','Added caching of uploaded file objects as an array.','2019-06-14 09:25:52'),(151,'Lovata.Toolbox','comment','1.24.1','Fixed copy() method in ElementCollection class.','2019-06-14 09:25:52'),(152,'Lovata.Toolbox','comment','1.25.0','Added classes for import elements from xml file.','2019-06-14 09:25:52'),(153,'Lovata.Toolbox','comment','1.25.1','Fixed openMainFile method in AbstractImportModelFromXML class.','2019-06-14 09:25:52'),(154,'Lovata.Toolbox','comment','1.25.2','Added try->catch section for removing images in AbstractImportModel class.','2019-06-14 09:25:52'),(155,'Lovata.Shopaholic','script','1.0.0','create_table_categories.php','2019-06-14 09:25:52'),(156,'Lovata.Shopaholic','script','1.0.0','create_table_products.php','2019-06-14 09:25:52'),(157,'Lovata.Shopaholic','script','1.0.0','create_table_offers.php','2019-06-14 09:25:52'),(158,'Lovata.Shopaholic','script','1.0.0','create_table_brands.php','2019-06-14